public int hashCode() {
  final int prime = 31;
  int result = 1;
  result = prime * result + (int) (expiryDate ^ (expiryDate >>> 32));
  result = prime * result + Arrays.hashCode(keyBytes);
  result = prime * result + keyId;
  return result;
}
